    //metodo che restituisce la lista degli Utenti Registrati
    public ArrayList<Utente> getUtentiRegistratiList()
    {
        return listaUtentiRegistrati;
    }
    
    //metodo che restituisce la lista degli Utenti Registrati per id
    public Utente getUtenteRegistrato(int id)
    {
        for(Utente u : listaUtentiRegistrati)
        {
            if(u.id == id)
                return u;
        }
        
        return null;
    }
    
    //metodo che restituisce la lista degli Utenti Registrati per nome
    public Utente getUtenteRegistrato(String nome)
    {
        for(Utente u : listaUtentiRegistrati)
        {
            if(u.Nome == nome)
                return (UtentiRegistrati) u;
        }
        
        return null;
    }
    
